import React from 'react';
import { Link } from 'react-router-dom';

const NavbarAdmin = () => {
  return (
    <nav>
      <ul>
        <li><Link to="/admin-dashboard">Panel de Administrador</Link></li>
        <li><Link to="/add-product">Agregar Producto</Link></li>
        <li><Link to="/manage-users">Gestionar Usuarios</Link></li>
      </ul>
    </nav>
  );
};

export default NavbarAdmin;
